import react from "react";
import React from "react";
import "./AsideCard.scss";

const AsideCard = (props) => {
  return (
    <article className="nextvideo__list">
      <>
        {props.videos.map((video) => (
          <p key={video.id}>
            {video.title}
            <br />
            {video.channel}
            <br />
            <img className="nextvideo__image" src={video.image} />
          </p>
        ))}
        <li>video list</li>
      </>
    </article>
  );
};

export default AsideCard;
